  const requestApi = async () => {
    const pokemnos = await fetch(
      "https://pokeapi.co/api/v2/pokemon?offset=0&limit=20"
    ).then((response) => response.json());
    return pokemnos;
  };

  return <div className="App">Hola</div>;
  requestApi();
};

export default App;
